import Header from './header';
import Footer from './footer';
function Contact() {
    return (
        <div>
            <Header />
            <main>
                <div></div>
                <div className="w-full text-center">
                    <h1>Let's bring your vision to life</h1>
                </div>
                <div></div>
            </main>
            <Footer />
        </div>
    )
  }
  export default Contact;
